import { useState } from 'react'
import Login from "./Login"
import Test from "./Test"

function Navbar (props) { 
    const [display, setDisplay] = useState("");

    const showLogin = (e, id) => {
        e.preventDefault()
        setDisplay(id)
    }

    return(
        <>
            <nav>
                <button onClick={(e) => showLogin(e, "signup")} href="/signup" className="u-pull-right button-primary">Signup</button>
                <button onClick={(e) => showLogin(e, "login")} href="/login" className="u-pull-right">Login</button>
                <div className="u-cf"></div>
            </nav>
            <Login id={display}/>
        </>
    )
}

export default Navbar;
